(1, 'Fresh2arrive', 'ewttest2016@gmail.com', 'signup', 'Signup', '<meta charset=\"utf-8\">\r\n<title></title>\r\n<table style=\"max-width: 600px;box-shadow: 0 8px 24px #e5e4e6; margin: 0px auto; height:  80px; background: #fff; width: 100%;\">\r\n	<tbody style=\"\">\r\n		<tr>\r\n			<th style=\"vertical-align: middle;text-align: center;height:  80px;background-color: #fff;\"><img src=\"https://fresh2arrive.eoxyslive.com/uploads/logo/1671019470-logo.png\" style=\"cursor: default;\" /></th>\r\n		</tr>\r\n		<tr>\r\n			<th style=\"text-align:center;padding: 20px 0px;\"><img src=\"https://fresh2arrive.eoxyslive.com/uploads/logo/Group347.png\" style=\"cursor: default;\" /></th>\r\n		</tr>\r\n		<tr>\r\n			<th style=\"padding:20px 40px 0px 40px;\">\r\n			<h6 style=\"margin: 0px; font-size: 18px; font-family: \'Raleway\', sans-serif; font-weight: 600; text-align: center; padding: 0px 0px 25px 0px; color: #436be2; \">Thanks for joining!</h6>\r\n\r\n			<h3 align=\"left\" style=\"margin: 0px;font-size: 32px;font-family: \'Raleway\', sans-serif;font-weight: 700;text-align: center;\">Your Registration is Complete.</h3>\r\n\r\n			<h6 align=\"left\" style=\"font-size: 15px;font-family: \'Raleway\', sans-serif;font-weight: 500; color:#4c4c53;line-height: 20px;margin: 20px 0px;text-align: center;\">Thanks for creating your Fresh2arrive account. To continue, Please Login your account by clicking the button below</h6>\r\n			</th>\r\n		</tr>\r\n		<tr style=\"\">\r\n			<th style=\"\">\r\n			<h3 style=\"margin: 10px 0px;font-size: 30px;font-family: \'Raleway\', sans-serif;font-weight: 800;text-align: center;color:#2b2e3e;\"><a href=\"{site_url}\" style=\"font-size: 18px; color: #fff; background-color: #436be2; padding: 10px 15px; border-radius: 5px; cursor: pointer; \">Login Your Account </a></h3>\r\n			</th>\r\n		</tr>\r\n	</tbody>\r\n</table>', 1, '2022-12-28 20:48:18', '2023-06-18 22:44:28', '2023-06-18 22:44:28'),
(2, 'Fresh2arrive', 'ewttest2016@gmail.com', 'delivered', 'Delivered', '<meta charset=\"utf-8\">\r\n<title></title>\r\n<table style=\"max-width: 600px;box-shadow: 0 8px 24px #e5e4e6; margin: 0px auto; height:  80px; background: #fff; width: 100%;\">\r\n	<tbody>\r\n		<tr>\r\n			<th style=\"vertical-align: middle;text-align: center;height:  80px;background-color: #fff;\"><img src=\"{image}\" style=\"cursor: default;\" /></th>\r\n		</tr>\r\n		<tr>\r\n			<th style=\"background: #436be2;padding: 30px;\">\r\n			<h5 style=\"font-size: 16px; font-family: \'Raleway\', sans-serif; font-weight: 600; text-align: center; color: #fff; margin: 0;\">Hello {name},</h5>\r\n\r\n			<h2 style=\"font-size: 34px; text-align: center; font-family: \'Raleway\', sans-serif; font-weight: 800;  color: #fff;margin: 0;\">Your Order Delivered !</h2>\r\n			</th>\r\n		</tr>\r\n		<tr>\r\n			<th style=\"padding:40px 40px 0px 40px;\">\r\n			<h5 align=\"left\" style=\"margin: 0px;font-size: 16px; font-family: \'Raleway\', sans-serif; font-weight: 600;\">Hi There!</h5>\r\n\r\n			<h6 align=\"left\" style=\"font-size: 15px; font-family: \'Raleway\', sans-serif; font-weight: 400; color:#4c4c53; line-height: 20px;  margin: 20px 0px;\">Thank you so much for your order. Your Product Successfully delivered to your address.</h6>\r\n\r\n			<p style=\"border-collapse: collapse; border-bottom: 1px solid #eaedf1;\">&nbsp;</p>\r\n			</th>\r\n		</tr>\r\n	</tbody>\r\n</table>', 1, '2023-02-15 06:52:39', '2023-06-18 22:44:26', '2023-06-18 22:44:26'),
(3, 'Fresh2arrive', 'ewttest2016@gmail.com', 'order placed', 'Order Placed', '<meta charset=\"utf-8\">\r\n<title></title>\r\n<table style=\"max-width: 600px;box-shadow: 0 8px 24px #e5e4e6; margin: 0px auto; height:  80px; background: #fff; width: 100%;\">\r\n	<tbody>\r\n		<tr>\r\n            <th style=\"vertical-align: middle;text-align: center;height:  80px;background-color: #fff;\"><img src=\"{image}\" style=\"cursor: default;\" /></th>\r\n        </tr>\r\n			\r\n		<tr>\r\n			<th style=\"background: #436be2;padding: 30px;\">\r\n				\r\n				<h2 style=\"font-size: 34px; text-align: center; font-family: \'Raleway\', sans-serif; font-weight: 800;  color: #fff;margin: 0;\">Your Order Placed !</h2>\r\n			</th>\r\n		</tr>\r\n		<tr>\r\n			<th style=\"padding:40px 40px 0px 40px;\">\r\n				<h5 align=\"left\" style=\"margin: 0px;font-size: 16px; font-family: \'Raleway\', sans-serif; font-weight: 600;\">Hi There!</h5>\r\n				<h6 align=\"left\" style=\"font-size: 15px; font-family: \'Raleway\', sans-serif; font-weight: 400; color:#4c4c53; line-height: 20px;  margin: 20px 0px;\"><span style=\"text-align: inherit;\">Thank you so much for your order. We are getting everything ready to send you and will let you know as soon as possible.</span><br></h6><h6 align=\"left\" style=\"margin: 20px 0px; line-height: 20px; font-size: 15px; font-family: Raleway, sans-serif; color: rgb(76, 76, 83);\">In the meantime, if you have any questions or concerns, please do not hesitate to reach out to us and we will be more than happy to help. Thanks again and have a great day.</h6>\r\n			</th>\r\n		</tr>\r\n		<tr>\r\n			<th style=\"padding:0px 40px;\">\r\n				<h3 style=\" margin: 10px 0px;font-size: 30px; font-family: \'Raleway\', sans-serif; font-weight: 800; color:#2b2e3e;\">Order Details</h3>\r\n			</th>\r\n		</tr>\r\n\r\n		<tr>\r\n			<td style=\"padding: 0px 40px;\">\r\n                <table style=\" width: 100%; border-collapse: collapse;   margin: 0 auto;\">\r\n                    <thead>\r\