(29, 'Zip', 'Customersupport@ziplimited.com', 'register', 'Registration OTP', '<meta http-equiv=\"Content-Type\" content=\"application/xhtml+xml; charset=utf-8\" /><meta http-equiv=\"X-UA-Compatible\" content=\"ie=edge\"><meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\"><!-- fonts link -->\r\n<link href=\"https://fonts.cdnfonts.com/css/avenir\" rel=\"stylesheet\" />\r\n<title></title>\r\n<style type=\"text/css\">@import url(\'https://fonts.googleapis.com/css2?family=Roboto+Slab:wght@100;200;300;400;500;600;700;800;900&display=swap\');\r\n         body {\r\n         margin: 0;\r\n         background-color: #F1F0EA;\r\n         }\r\n         table {\r\n         border-spacing: 0;\r\n         }\r\n         td {\r\n         padding: 0;\r\n         }\r\n         img {\r\n         border: 0;\r\n         }\r\n         @media screen and (max-width: 450px){\r\n         h4{\r\n         font-size: 12px!important;\r\n         }\r\n         h5 {\r\n         font-size: 10px!important;\r\n         }\r\n         p{\r\n         font-size: 11px!important;\r\n         }\r\n         .logo {\r\n         width: 70px!important;\r\n         }\r\n         .box-2 {\r\n         margin-left: 5px!important;\r\n         }\r\n         h3 {\r\n         font-size: 18px!important;\r\n         }\r\n         span {\r\n         font-size: 12px!important;\r\n         }\r\n         h6 {\r\n         font-size: 10px!important;\r\n         }\r\n         .f-h-tag {\r\n         display: block!important;\r\n         padding-bottom: 7px!important;\r\n         }\r\n         .otp-sec {\r\n         max-width: 450px!important;\r\n         }\r\n         .content-w-bg {\r\n         max-width: 255px!important;\r\n         padding: 15px 0px!important;\r\n         }\r\n         .content-p {\r\n         max-width: 250px!important;\r\n         }\r\n         .heading-tag {\r\n         font-size: 15px!important;\r\n         }\r\n         .otp-tag {\r\n         max-width: 230px!important ;\r\n         }\r\n         }\r\n</style>\r\n<center class=\"wrapper\" style=\"background-color: #FFFFFF;\">\r\n<table cellpadding=\"0\" cellspacing=\"0\" class=\"main\" style=\"background-color: #fefcf3; width: 100%; max-width: 600px; margin: 0 auto; border: 2px solid #BDC3C7; font-family: \'Roboto Slab\', serif; color: #2C3E50; padding-bottom: 10px;\" width=\"100%\"><!-- logo section -->\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"padding: 14px 24px 14px 24px;\"><a href=\"#\"><img alt=\"logo\" border=\"0\" src=\"https://i.ibb.co/JKpCB4N/Layer-x0020-1.png\" style=\"width: 100px;\" /></a></td>\r\n		</tr>\r\n		<!-- heading Name -->\r\n		<tr>\r\n			<td>\r\n			<h4 style=\"margin: 0 24px;  padding-bottom: 20px ; font-size: 20px; padding-bottom:30px!important;\">Hello <span id=\"\" style=\"color: #1D8348\">{name}</span></h4>\r\n\r\n			<table>\r\n			</table>\r\n			</td>\r\n			<!-- OTP Section -->\r\n		</tr>\r\n		<tr>\r\n			<td align=\"center\">\r\n			<div class=\"otp-sec\" style=\" width:100%; max-width: 515px; padding-bottom: 10px; padding-top: 5px;\"><!-- content-p -->\r\n			<p align=\"center\" class=\"content-p\" style=\"font-weight: 600; font-size: 12px; width: 100%;\">Welcome to zip! We&#39;re thrilled to have you as our newest member.Before we get started, we would like to ensure the secuirty of your accoun, please complete the one-time passowrd(OTP) verification process.</p>\r\n			<!-- heading-tag -->\r\n\r\n			<h2 class=\"heading-tag\" style=\" text-align: center; font-weight: 800; font-size:18px; color: #14070d; margin: 20px 0 10px 0;\">Here is your OTP</h2>\r\n			<!-- otp tag -->\r\n\r\n			<h2 class=\"otp-tag\" style=\" background-color: #4a4a4a; width: 100%; max-width: 350px; color: #f5f5f5; font-size: 28px; padding: 8px 0; border-radius: 22px; margin: 0 0;text-align: center!important;\"><strong style=\"letter-spacing: 14px;  \">{otp}</strong></h2>\r\n			<!-- content-p -->\r\n\r\n			<p class=\"content-p\" style=\"font-weight: 900; font-size: 12px; width: 100%; color: #17202A; font-family: opens-sans; padding-bottom: 10px!important;\">Please note that your OTP is valid for limited time. If it expires before you can enter it, you can request a new otp directly form the App.</p>\r\n			<!-- i used this p for border -->\r\n\r\n			<p style=\" max-width: 450px; border-top: 1px solid #ABB2B9; padding-bottom: 10px;\">&nbsp;</p>\r\n			<!-- content-p -->\r\n\r\n			<p class=\"content-p\" style=\"font-weight: 600; font-size: 12px; width: 100%; padding-bottom: 15px;\">Once your OTP succesfully verified, you gain full acces to all the amzaing features and benefits of ZIP App.Enjoy sealess transactions, convenvenient money transfers, and much more!</p>\r\n			<!-- content-w-bg -->\r\n\r\n			<p class=\"content-w-bg\" style=\"background-color: #4a4a4a; width: 100%; max-width: 400px; color: #ABB2B9; font-size: 11px; padding: 14px 10px; border-radius: 22px; margin: 10px 0;\">If you did not attempt to sign up for an account wit Zip, please disregard this email or Contact our friendly customer support team immediately at <strong style=\"color: #1D8348;\">info@ziplimited.com </strong> to report suspicous activites</p>\r\n			</div>\r\n\r\n			<table>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n		<!-- regard section -->\r\n		<tr>\r\n			<td>\r\n			<h5 style=\"margin: 5px 22px; font-weight: 600;\">Best Regards,</h5>\r\n\r\n			<h6 style=\"margin: 0px 22px; padding-bottom: 30px;\">ZIP cash Team</h6>\r\n\r\n			<table>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n		<!-- footer logo -->\r\n		<tr>\r\n			<td style=\"padding: 20px 24px;\"><a href=\"#\"><img alt=\"logo\" border=\"0\" src=\"https://i.ibb.co/JKpCB4N/Layer-x0020-1.png\" style=\"width: 60px;\" /></a></td>\r\n		</tr>\r\n		<!-- footer -->\r\n		<tr>\r\n			<td>\r\n			<div align=\"center\" style=\"background-color:#ebebeb; border: 2px solid #BDC3C7; margin: 10px 5px; padding: 20px; \">\r\n			<h3 class=\"f-h-tag\" style=\"color: #785a08; font-size:22px!important; display: inline-block; \">Let&#39;s stay connected</h3>\r\n			<a class=\"a-tag-resp\" href=\"#\" style=\"display: inline-block; text-decoration: none; margin-right: 10px; margin-left: 55px;\"><img alt=\"Facebook Icon\" src=\"https://i.ibb.co/xYcdf96/21155.png\" style=\"display: block; width: 20px; height: auto;\" /></a> <a href=\"#\" style=\"display: inline-block; text-decoration: none; margin-right: 10px; \"><img alt=\"LinkedIn Icon\" src=\"https://i.ibb.co/2MtdMrK/linkedin.png\" style=\"display: block; width: 20px; height: auto;\" /></a> <a href=\"#\" style=\"display: inline-block; text-decoration: none; margin-right: 10px;\"><img alt=\"Instagram Icon\" src=\"https://i.ibb.co/5Kh19xq/5a432579b8d308657040d646ca7b3331.png\" style=\"display: block; width: 20px; height: auto;\" /></a> <a href=\"#\" style=\"display: inline-block; text-decoration: none; margin-right: 10px;\"><img alt=\"Twitter Icon\" src=\"https://i.ibb.co/f0JjMvy/twitter-x-logo-42554.png\" style=\"display: block; width: 20px; height: auto;\" /></a> <a href=\"#\" style=\"display: inline-block; text-decoration: none; margin-right: 10px;\"><img alt=\"Instagram Icon\" src=\"https://i.ibb.co/bRbF3WS/insta-png.png\" style=\"display: block; width: 20px; height: auto;\" /></a> <a href=\"#\" style=\"display: inline-block; text-decoration: none; margin-right: 10px;\"><img alt=\"Instagram Icon\" src=\"https://i.ibb.co/TY95GrQ/whts-1.png\" style=\"display: block; width: 20px; height: auto;\" /></a>\r\n\r\n			<div style=\"padding-top: 5px!important;\"><small style=\"\">Copyright &copy; 2023 ZIP International Limited All rights reserved</small></div>\r\n			</div>\r\n\r\n			<table>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</center>', 0, '2023-06-19 23:34:54', '2024-03-19 16:28:52', NULL),
