(31, 'Zip', 'Customersupport@ziplimited.com', 'pin_reset', 'Pin Reset OTP', '<table style=\"max-width: 600px;box-shadow: 0 8px 24px #e5e4e6; margin: 0px auto; height:  80px; background: #fff; width: 100%;\">\r\n	<tbody>\r\n		<tr style=\"\r\n    background: #325187;\r\n\">\r\n			<th><img src=\"https://zipfintech.eoxyslive.com/uploads/ziploago.png\" style=\"height: 100px;padding-top: 4px;width: 100px;\" /></th>\r\n		</tr>\r\n		<tr>\r\n			<th style=\"text-align:left\">\r\n			<p style=\"\r\n    text-align: left;\r\n    color: black;\r\n\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Your OTP: {otp}</p>\r\n			</th>\r\n		</tr>\r\n		<tr>\r\n		</tr>\r\n	</tbody>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n	<tbody>\r\n		<tr>\r\n			<th style=\"\r\n    background: #325187;\r\n    opacity: 1;\r\n    height: 137px;\r\n\">\r\n			<div style=\"\r\n    display: flex;\r\n    width: 100%;\r\n    /* justify-content: space-evenly; */\r\n\">\r\n			<div style=\"width: 50%;\"><font color=\"#ffffff\">Link1</font></div>\r\n\r\n			<div style=\"\r\n    width: 50%;\r\n\"><font color=\"#ffffff\">Link2</font></div>\r\n			</div>\r\n\r\n			<pre style=\"\r\n    color: white;\r\n\">\r\nThis is footer of mail template </pre>\r\n			</th>\r\n		</tr>\r\n	</tbody>\r\n</table>', 0, '2023-06-19 23:34:54', '2024-03-19 16:29:03', NULL),
(32, 'Zip', 'Customersupport@ziplimited.com', 'support', 'Support Query', '<meta charset=\"utf-8\">\r\n<title></title>\r\n<table style=\"max-width: 600px;box-shadow: 0 8px 24px #e5e4e6; margin: 0px auto; height:  80px; background: #fff; width: 100%;\">\r\n	<tbody>\r\n		<tr style=\"\r\n    background: #325187;\r\n\">\r\n			<th><img src=\"https://zipfintech.eoxyslive.com/uploads/ziploago.png\" style=\"height: 100px;padding-top: 4px;width: 100px;\" /></th>\r\n		</tr>\r\n		<tr>\r\n			<th style=\"padding:40px 40px 0px 40px;\">\r\n			<h5 align=\"left\" style=\"margin: 0px;font-size: 16px; font-family: \'Raleway\', sans-serif; font-weight: 600;\">Hello Admin,</h5>\r\n\r\n			<p style=\"margin: 0px; font-size: 16px; font-family: Raleway, sans-serif; font-weight: 600;\">&nbsp;</p>\r\n\r\n			<p style=\"font-size: 16px; font-weight:400;\">user wants to contact with your team regarding ZipFinTech app queries.</p>\r\n			</th>\r\n		</tr>\r\n		<tr>\r\n			<th style=\"padding:0px 40px;\">\r\n			<h3 style=\" margin: 10px 0px;font-size: 24px; font-family: \'Raleway\', sans-serif; font-weight: 700; color:#2b2e3e;\">User Details</h3>\r\n			</th>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"padding: 0px 40px 50px 40px;\">\r\n			<table class=\"tab\" style=\" width: 100%;   margin: 0 auto; \">\r\n				<tbody style=\"border-bottom:30px\">\r\n					<tr style=\"border-collapse: collapse;\">\r\n						<td style=\"\">\r\n						<h6 style=\"font-size: 16px; font-family: \'Raleway\', sans-serif; font-weight: 500; /* color:#4c4c53; */margin: 10px 0px;  \">Email/Phone:</h6>\r\n						</td>\r\n						<td style=\"\">\r\n						<h6 align=\"center\" style=\"font-size: 15px; font-family: \'Raleway\', sans-serif; font-weight: 800; color:#4c4c53;  align: center;\">&nbsp;</h6>\r\n						</td>\r\n						<td style=\"\">\r\n						<h6 align=\"\" style=\"font-size: 15px; font-family: \'Raleway\', sans-serif; font-weight: 400; color:#4c4c53;  align: right; margin: 10px 0px;\"><span style=\"font-family: &quot;IBM Plex Sans&quot;, sans-serif; font-size: 16px;\">&nbsp;{email}</span></h6>\r\n						</td>\r\n					</tr>\r\n					<tr style=\"border-collapse: collapse;\">\r\n						<td style=\"\">\r\n						<h6 style=\"font-size: 16px; font-family: \'Raleway\', sans-serif; font-weight: 500; color:#4c4c53;margin: 10px 0px;  \">Message:</h6>\r\n						</td>\r\n						<td style=\"\">\r\n						<h6 align=\"center\" style=\"font-size: 15px; font-family: \'Raleway\', sans-serif; font-weight: 800; color:#4c4c53;  align: center;\">&nbsp;</h6>\r\n						</td>\r\n						<td style=\"\">\r\n						<h6 align=\"\" style=\"font-size: 15px; font-family: \'Raleway\', sans-serif; font-weight: 400; color:#4c4c53;  align: right; margin: 10px 0px;\">{message}</h6>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', 0, '2023-07-06 11:42:31', '2024-03-19 16:28:37', NULL),
(33, 'Zip', 'Customersupport@ziplimited.com', '2FA', '2FA verification', '<meta charset=\"utf-8\">\r\n<title></title>\r\n<table style=\"max-width: 600px;box-shadow: 0 8px 24px #e5e4e6; margin: 0px auto; height:  80px; background: #fff; width: 100%;\">\r\n	<tbody>\r\n		<tr style=\"\r\n    background: #325187;\r\n\">\r\n			<th><img src=\"https://zipfintech.eoxyslive.com/uploads/ziploago.png\" style=\"height: 100px;padding-top: 4px;width: 100px;\" /></th>\r\n		</tr>\r\n		<tr>\r\n			<th style=\"padding:40px 40px 0px 40px;\">\r\n			<h5 align=\"left\" style=\"margin: 0px;font-size: 16px; font-family: \'Raleway\', sans-serif; font-weight: 600;\">&nbsp;</h5>\r\n			</th>\r\n		</tr>\r\n		<tr>\r\n			<th style=\"padding:0px 40px;\">\r\n			<h3 style=\" margin: 10px 0px;font-size: 24px; font-family: \'Raleway\', sans-serif; font-weight: 700; color:#2b2e3e;\">Two Fector Authentication Code : {otp}</h3>\r\n			</th>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"padding: 0px 40px 50px 40px;\">&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', 0, '2023-08-07 13:37:07', '2023-12-01 11:35:08', NULL),
