x 22px; padding-bottom: 30px;\"><span style=\"font-family: &quot;Times New Roman&quot;, Times, serif; font-size: 16px;\">ZIP Cash Team</span></h5>\r\n\r\n			<table>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n		<!-- footer logo -->\r\n		<tr>\r\n			<td style=\"padding: 20px 24px;\">\r\n			<div><a href=\"#\"><img alt=\"logo\" border=\"0\" src=\"https://i.ibb.co/JKpCB4N/Layer-x0020-1.png\" style=\"width: 60px;\" /></a></div>\r\n			</td>\r\n		</tr>\r\n		<!-- footer -->\r\n		<tr>\r\n			<td>\r\n			<div align=\"center\" style=\"background-color:#ebebeb; border: 2px; margin: 10px 5px; padding: 20px;\">\r\n			<h3 class=\"f-h-tag\" style=\"color: #785a08; font-size:22px!important; display: inline-block;\">Let&#39;s stay connected</h3>\r\n			<a class=\"a-tag-resp\" href=\"#\" style=\"display: inline-block; text-decoration: none; margin-right: 10px; margin-left: 55px;\"><img alt=\"Facebook Icon\" src=\"https://i.ibb.co/xYcdf96/21155.png\" style=\"display: block; width: 20px; height: auto;\" /></a> <a href=\"#\" style=\"display: inline-block; text-decoration: none; margin-right: 10px;\"><img alt=\"LinkedIn Icon\" src=\"https://i.ibb.co/2MtdMrK/linkedin.png\" style=\"display: block; width: 20px; height: auto;\" /></a> <a href=\"#\" style=\"display: inline-block; text-decoration: none; margin-right: 10px;\"><img alt=\"Instagram Icon\" src=\"https://i.ibb.co/5Kh19xq/5a432579b8d308657040d646ca7b3331.png\" style=\"display: block; width: 20px; height: auto;\" /></a> <a href=\"#\" style=\"display: inline-block; text-decoration: none; margin-right: 10px;\"><img alt=\"Twitter Icon\" src=\"https://i.ibb.co/f0JjMvy/twitter-x-logo-42554.png\" style=\"display: block; width: 20px; height: auto;\" /></a> <a href=\"#\" style=\"display: inline-block; text-decoration: none; margin-right: 10px;\"><img alt=\"Instagram Icon\" src=\"https://i.ibb.co/bRbF3WS/insta-png.png\" style=\"display: block; width: 20px; height: auto;\" /></a> <a href=\"#\" style=\"display: inline-block; text-decoration: none; margin-right: 10px;\"><img alt=\"Instagram Icon\" src=\"https://i.ibb.co/TY95GrQ/whts-1.png\" style=\"display: block; width: 20px; height: auto;\" /></a>\r\n\r\n			<div style=\"padding-top: 5px!important;\"><small>Copyright &copy; 2023 ZIP International Limited All rights reserved</small></div>\r\n			</div>\r\n\r\n			<table>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</center>', 1, '2023-10-30 11:43:17', '2024-03-14 18:33:26', NULL);
