(50, 'Payment link send', 'Customersupport@ziplimited.com', 'Payment link send', 'Payment link send', '<title></title>\r\n<meta http-equiv=\"Content-Type\" content=\"application/xhtml+xml; charset=utf-8\"><meta http-equiv=\"X-UA-Compatible\" content=\"ie=edge\"><meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\r\n<p><br />\r\n<!-- fonts link --></p>\r\n<link href=\"https://fonts.cdnfonts.com/css/avenir\" rel=\"stylesheet\" />\r\n<p><br />\r\n<style type=\"text/css\">@import url(\'https://fonts.googleapis.com/css2?family=Roboto+Slab:wght@100;200;300;400;500;600;700&display=swap\')\r\n         body {\r\n         margin: 0;\r\n         background-color: #F1F0EA;\r\n         }\r\n         table {\r\n         border-spacing: 0;\r\n         }\r\n         td {\r\n         padding: 0;\r\n         }\r\n         img {\r\n         border: 0;\r\n         }\r\n         @media screen and (max-width: 450px){\r\n         h4{\r\n         font-size: 11px!important;\r\n         }\r\n         h5 {\r\n         font-size: 10px!important;\r\n         }\r\n         p{\r\n         font-size: 12px!important;\r\n         }\r\n         .logo {\r\n         width: 70px!important;\r\n         }\r\n         .box-2 {\r\n         margin-left: 5px!important;\r\n         }\r\n         h3 {\r\n         font-size: 18px!important;\r\n         }\r\n         span {\r\n         font-size: 12px!important;\r\n         }\r\n         h6 {\r\n         font-size: 10px!important;\r\n         }\r\n         .f-h-tag {\r\n         display: block!important;\r\n         padding-bottom: 7px!important;\r\n         }\r\n         .a-tag-resp {\r\n         margin-left: 0px!important;\r\n         }\r\n         }\r\n</style>\r\n</p>\r\n\r\n<center class=\"wrapper\" style=\"background-color: #FFFFFF;\">\r\n<table cellpadding=\"0\" cellspacing=\"0\" class=\"main\" style=\"background-color: #fefcf3; width: 100%; max-width: 700px; margin: 0 auto; border: 2px; font-family: \'Roboto Slab\', serif; color: #2